import React from "react";
import { Container } from "react-bootstrap";
import "./style.css";
const App = () => {
  const students = ["waliullah", "Habiba", "Ayesha", "Fatima"];

  return (
    <>
      <Container className="text-center">
        <h2> Handle Array With List</h2>

        {students.map((data) => (
          <h1>{data}</h1>
        ))}
      </Container>
    </>
  );
};

export default App;
